coef1=651245335468721456874632716543564189756724
coef2=312564687351120557683216874563168735762335

c = pow(m,eq1,n)

output1=pow((p-2*q),coef1,n)
output2=pow((p+3*q),coef2,n)
print(output1)
print(output2)
print(c)
print(n)

